	add("teraphim", "{\"term\":\"teraphim\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\", \"Hebrew\", \"Latin\"], \"text\":\"From ecclesiastical Latin \u0027theraphim\u0027 from Ancient greek (to 1453) \u0027θεραφίν\u0027 from Hebrew \u0027תְּרָפִים\u0027 (household gods) perhaps from\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An idol or other image of reverence and divination among the ancient Hebrews; apparently especially a kind of household god\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1611\u0027\u0027, And the priest\u0027s heart was glad, and he took the ephod, and the teraphim, and the graven image, and went in the midst of the people. — Judges 18:20, King James Versio\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"1658\u0027\u0027, And [...] the \u0027Statuæ Isiacæ\u0027, \u0027\u0027Teraphims\u0027\u0027, and little Idols, found about the Mummies, do make a decussation or \u0027Jacobs\u0027 Crosse with their armes — Sir Thomas Browne, \u0027The Garden of Cyrus\u0027 (Folio Society 2007, p. 191\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Plural use example:- [http://en.wikisource.org/wiki/Bible_%28World_English%29/Genesi\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Chapter_31 Genesis 31:30 \u0026amp; 34\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Singular use example:- [http://en.wikisource.org/wiki/Bible_%28World_English%29/1_Samue\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Chapter_19 1 Samuel 19:13 \u0026amp; 16\", \"priority\":7}]}, \"synonyms\":{}}");

