	add("teresa", "{\"term\":\"teresa\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"First recorded as the name of a fourth century Spanish saint. Of obscure origin, suggestions include Therasia or Thera, ancient name of the Greek island \u0027\u0027Thira\u0027\u0027.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"the Spanish and Italian form of Theresa\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1980\u0027\u0027 Laura Furman: \u0027The Glass House, a Novella and Stories.\u0027 Viking Press 1980. ISBN 0670341797 page 76\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"My friends call me Terry. My husband always used my full name, \u0027\u0027Teresa\u0027\u0027. He said it made him feel like he was married to a foreign woman\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1999\u0027\u0027 , \u0027The Big Bad City\u0027, Simon and Schuster, ISBN 0671025694, page 139\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Cynthia and Melinda, reduced to Cindy and Mindy, as Carella had dreaded would happen from the moment she named them. Her older daughter had fared better. Tess, modern and sleek for \u0027\u0027Teresa\u0027\u0027, which conjured up cobblestoned streets in a mountain village in Potenza\", \"priority\":5}]}, \"synonyms\":{}}");

