	add("termagant", "{\"term\":\"termagant\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From \u0027termagant\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A quarrelsome, scolding woman, especially one who is old and shrewish\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1663\u0027\u0027, Hudibras\u0027, by Samuel Butler, part 1, s:Hudibras/Part 1/Canto canto\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Make feeble ladies, in their works, / To fight like \u0027\u0027termagants\u0027\u0027 and Turks\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1907\u0027\u0027, Isaac Flagg, \u0027Plato: the Apology and Crito\u0027, p. 196\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The name of Xanthippe, the wife of Socrates, has become proverbial for a \u0027\u0027termagant\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"1970\u0027\u0027, Robertson Davies, \u0027Fifth Business\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Easier divorce, equal pay for equal work as between men and women, no discrimination between the sexes in employment – these were her causes, and in promoting them she was no comic-strip feminist \u0027\u0027termagant\u0027\u0027, but reasonable, logical, and untiring\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"A boisterous, brawling, turbulent person, whether male or female\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"Bale (1543\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"This terrible \u0027\u0027termagant\u0027\u0027, this Nero, this Pharaoh\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"Macaula\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"The slave of an imperious and reckless \u0027\u0027termagant\", \"priority\":12}]}, \"synonyms\":{}}");

